import {useState} from 'react'

const Header =(props)=>{

    const [counter, setCounter] = useState(0)

    const onButtonClicked =()=>{
        setCounter(counter+1)
    }

    return(
        <div>
            <p>
                {props.toUpper(props.name)}
            </p>

            <p>
                {counter}
            </p>

            <button onClick={()=>{onButtonClicked()}}/>

        </div>
    )
}

export default Header
